import React from "react";

function Tours(){
  return(
    <>
    {
      props.tours.map(oneTour =>{
        return(
          <div>
            <hr />
            <p>id : {oneTour.id}</p>
            <h3>Name: {oneTour.name}</h3>
            <p>Info: {oneTour.info}</p>
            <img width={"200px"} src={oneTour.image} alt=""/>
            <p>Price: {oneTour.price}</p>
            <hr />
          </div>
        )

      })
    }
    </>
  )
}

export default Tours;
